import React from 'react';
import './card.css'

class Card extends React.Component {
  render () {
    return (
    <div className="card">
      <div className="innerCard">
        <div className="frontCard">
          <img src={this.props.image}></img>
        </div>
      </div>
    
    </div>
  );
}
}

export default Card;
